DROP PROCEDURE IF EXISTS load_user_test_data;
DELIMITER // 
CREATE PROCEDURE load_user_test_data()
BEGIN
DECLARE v_max int default 1000;
DECLARE v_counter int default 0;
	start transaction;
	while v_counter < v_max do
		INSERT INTO `flight`(departureTime, arrivalTime, arrivalCity, departureCity) VALUES
		(sec_to_time(round(rand()*79200)%86399), sec_to_time((time_to_sec(departureTime) + round(rand()*7200))%86399), ((round((rand()*1000))%26) + 1000), ((round((rand()*1000))%26) + 1000));
		set v_counter = v_counter + 1;
	end while;
	commit;
end;//
DELIMITER ;

CALL load_user_test_data();
 
